import { Player } from 'video-react'

const IndexPage = () => {
    return (
        <div>
            {/* <Player>
                <source src="https://youtu.be/jF2UdLgGxuw" />
            </Player> */}
            <div>
                <iframe width="1000" height="315" src="https://www.youtube.com/embed/jF2UdLgGxuw" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>
        </div>
    )
  }

  export default IndexPage;
